import './App.css';
import Header from './Header';
import Recommended from './Recommended';
import Sidebar from './Sidebar';
import { BrowserRouter as Router, Switch,Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Header/>
      <Router>
        <Switch>
          <Route path='/'>  
            <div className='app_page'>
               <Sidebar/>
               <Recommended/>
            </div>
          </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
